/*Table structure for table `tblapprovelate` */

DROP TABLE IF EXISTS `tblapprovelate`;

CREATE TABLE `tblapprovelate` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `idtimesheet` int(11) DEFAULT NULL,
  `id_period` int(11) DEFAULT NULL,
  `date_approve` date DEFAULT NULL,
  `pay_date` date DEFAULT NULL,
  `stat` int(1) DEFAULT 0 COMMENT '0=Open;1=Close',
  PRIMARY KEY (`id`),
  KEY `approvelate1` (`idtimesheet`),
  KEY `approvelate2` (`id_period`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

