insert  into `tbldocutemp`(`id`,`name`,`type`,`status`,`remarks`,`content`,`idacct`) values (19,'Certificate of Employment - COVID-19','certificates','AC','Certificate of Employment for COVID19 Work Schedule','<p style=\"margin: 0in 0in 0.0001pt; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif; text-align: left;\" align=\"center\"><strong><span style=\"font-size: 20.0pt;\"><img src=\"data:image/png;base64,\" width=\"276\" height=\"69\" /></span></strong></p>\n<p style=\"margin: 0in 0in 0.0001pt; text-align: center; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\" align=\"center\">&nbsp;</p>\n<p style=\"margin: 0in 0in 0.0001pt; text-align: center; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\" align=\"center\"><strong><span style=\"font-size: 20.0pt;\">CERTIFICATE OF EMPLOYMENT&nbsp; &nbsp;</span></strong></p>\n<p style=\"margin: 0in 0in 0.0001pt; text-align: center; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\" align=\"center\">&nbsp;</p>\n<p style=\"margin: 0in 0in 0.0001pt; text-align: justify; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\"><strong><u><span style=\"font-size: 12.0pt;\">To Whom It May Concern: </span></u></strong></p>\n<p style=\"margin: 0in 0in 0.0001pt; text-align: justify; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\">&nbsp;</p>\n<p style=\"text-align: justify; margin: 0in 0in 8pt; line-height: 107%; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\"><span style=\"font-size: 12.0pt; line-height: 107%;\">This is to certify that {first name} {middle initial} {last name}&nbsp; is an active employee of the company who reports to our Mandaue Office from Monday to Saturday 8:00 AM to 5:00 PM located at <strong>Unit 9, The Green Strip, S.E., Jayme St., Paknaan, Mandaue City, Cebu. </strong>He was not diagnosed nor sick with Covid 19 virus.</span></p>\n<p style=\"margin: 0in 0in 0.0001pt; text-align: justify; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\"><span style=\"font-size: 12.0pt;\">This company is engaged in the Delivery of Services such activities related to provide Technical support, Maintenance of Equipment/System and delivery of Equipment consumables necessary for the continued operation of its clients which are banks, hospitals, production offices, groceries, hotels, etc.</span></p>\n<p style=\"margin: 0in 0in 0.0001pt; text-align: justify; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\"><span style=\"font-size: 12.0pt;\">&nbsp;</span></p>\n<p style=\"margin: 0in 0in 0.0001pt; text-align: justify; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\"><strong><span style=\"font-size: 12.0pt;\">Clients we are currently supporting are the following:</span></strong></p>\n<p style=\"margin: 0in 0in 0.0001pt; text-align: justify; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\"><span style=\"font-size: 12.0pt;\">&nbsp;</span></p>\n<ul style=\"margin-top: 0in; margin-bottom: .0001pt;\">\n<li style=\"margin: 0in 0in 0.0001pt 0px; text-align: justify; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\"><strong><span style=\"font-size: 12.0pt;\">Banks</span></strong><span style=\"font-size: 12.0pt;\"> (BDO, PNB, PBCom, Unibank, AUB, FAIR Bank, etc.)</span></li>\n<li style=\"margin: 0in 0in 0.0001pt 0px; text-align: justify; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\"><strong><span style=\"font-size: 12.0pt;\">Hospitals</span></strong><span style=\"font-size: 12.0pt;\"> (Cebu Doctors Hospital, Ceb South Gen. Hospital, Mactan Doctors Hospital, ARC Hospital, Mendero Hospital, etc.</span></li>\n<li style=\"margin: 0in 0in 0.0001pt 0px; text-align: justify; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\"><strong><span style=\"font-size: 12.0pt;\">Manufacturing </span></strong><span style=\"font-size: 12.0pt;\">( Prifoods Corp., Profood Corp., LEAR Corp, etc.)</span></li>\n<li style=\"margin: 0in 0in 0.0001pt 0px; text-align: justify; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\"><strong><span style=\"font-size: 12.0pt;\">Logistics </span></strong><span style=\"font-size: 12.0pt;\">(Fast Cargo, etc.)</span></li>\n<li style=\"margin: 0in 0in 0.0001pt 0px; text-align: justify; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\"><strong><span style=\"font-size: 12.0pt;\">Hotels</span></strong><span style=\"font-size: 12.0pt;\"> ( Waterfront Hotels, Seda Hotels, Shangrila Resort, etc,)</span></li>\n</ul>\n<p style=\"margin: 0in 0in 0.0001pt 1in; text-align: justify; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\"><span style=\"font-size: 12.0pt;\">&nbsp; </span></p>\n<p style=\"margin: 0in 0in 0.0001pt; text-align: justify; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\"><span style=\"font-size: 12.0pt;\">This certification is being issued to allow Him to have access through PNP/AFP or any Government designated checkpoints in any of the entry points to Cebu during the &ldquo; Enhanced Community Quarantine&rdquo; period in line with the proclamation made by the President of the Philippines, last March 12, 2020 and for other legal purpose it may serve.</span></p>\n<p style=\"margin: 0in 0in 0.0001pt; text-align: justify; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\"><span style=\"font-size: 12.0pt;\">&nbsp;</span></p>\n<p style=\"margin: 0in 0in 0.0001pt; text-align: justify; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\"><span style=\"font-size: 12.0pt;\">Issued this {date issued}&nbsp;in the city of Mandaue.</span></p>',1),(20,'COE - Compensation not included','certificates','AC','COE Company','<p style=\"margin: 0in 0in 0.0001pt; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif; text-align: left;\" align=\"center\"><strong><span style=\"font-size: 20pt;\"><img src=\"data:image/png;base64,\" width=\"276\" height=\"69\" /></span></strong></p>\n<p style=\"margin: 0in 0in 0.0001pt; text-align: center; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\" align=\"center\">&nbsp;</p>\n<p style=\"margin: 0in 0in 0.0001pt; text-align: center; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\" align=\"center\"><strong><span style=\"font-size: 20pt;\">CERTIFICATE OF EMPLOYMENT&nbsp; &nbsp;</span></strong></p>\n<p style=\"margin: 0in 0in 0.0001pt; text-align: center; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\" align=\"center\">&nbsp;</p>\n<p style=\"margin: 0in 0in 0.0001pt; text-align: justify; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\">&nbsp;</p>\n<p style=\"text-align: justify; margin: 0in 0in 8pt; line-height: 107%; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\"><span style=\"font-size: 12pt; line-height: 107%;\">This is to certify that {first name} {middle initial} {last name} was an employee of Delsan Business Innovations Corporation from August 03, 2015 up to present as UX/UI Designer</span></p>\n<p style=\"margin: 0in 0in 0.0001pt 1in; text-align: justify; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\"><span style=\"font-size: 12pt;\">&nbsp; </span></p>\n<p style=\"margin: 0in 0in 0.0001pt; text-align: justify; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\"><span style=\"font-size: 12pt;\">This certification is being issued to Mr. <span style=\"font-size: 12pt; line-height: 107%;\">{first name} {middle initial} {last name}</span> for whatever legal purpose it may serve.</span></p>\n<p style=\"margin: 0in 0in 0.0001pt; text-align: justify; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\"><span style=\"font-size: 12pt;\">&nbsp;</span></p>\n<p style=\"margin: 0in 0in 0.0001pt; text-align: justify; line-height: normal; font-size: 11pt; font-family: \'Century Gothic\', sans-serif;\"><span style=\"font-size: 12pt;\">Given this {date issued} in the city of Mandaue.</span></p>',1),(21,'Notice to Explain - Tardines','lan','AC','Tardiness','<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Date: <span style=\"font-size: 12pt;\">{date issued}</span> </span></p>\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\"> From: HR Department </span></p>\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\">To: <span style=\"text-decoration: underline;\"><span style=\"font-size: 12pt;\"><span style=\"font-size: 12pt; line-height: 107%;\">{first name} {middle initial} {last name}</span></span> </span></span></p>\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Subject:&nbsp; <strong>NOTICE TO EXPLAIN</strong><br /></span></p>\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Based on the summary of your latest attendance records, you have incurred the following habitual tardiness: </span></p>\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Dates Tardiness&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;:From________________ To ________________</span></p>\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\">No. of minutes / No. of times :______________minutes&nbsp; ______________times</span></p>\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Under the Labor Code, habitual tardiness constitutes gross and habitual neglect of duties which </span><span style=\"font-size: 10pt;\">may be cause for suspension/termination. </span></p>\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\">In view thereof, you are hereby directed to submit your written explanation within five (5) days upon receipt of this memo as to why no disciplinary action shall be taken against you. </span></p>\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Failure to submit your written explanation within the prescribed period means that you waived your opportunity to be heard and constitutes admission of the alleged offense and the company shall decide the matter on the basis of all records and evidence available to it.</span></p>\n<p style=\"text-align: left;\">&nbsp;</p>\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Received by:</span></p>\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\">_____________________<br /></span><span style=\"font-size: 10pt;\">Employee Signature<br /><br /></span></p>',105);

