  `id` int(11) NOT NULL AUTO_INCREMENT,
  `idconf` int(11) DEFAULT NULL,
  `acct_id` varchar(150) COLLATE utf8_unicode_ci DEFAULT NULL,
  `idunit` int(11) DEFAULT NULL,
