  `work_date` date DEFAULT NULL,
  `work_time` varchar(150) COLLATE utf8_unicode_ci DEFAULT NULL,
  `time_type` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `date_pair` varchar(150) COLLATE utf8_unicode_ci DEFAULT NULL,
  `ispaired` int(1) DEFAULT 0 COMMENT '0=not paired; 1=paired',
  PRIMARY KEY (`id`),
  KEY `timeKey1` (`work_date`),
  KEY `timeKey2` (`acct_id`)
) ENGINE=MyISAM AUTO_INCREMENT=789 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

