/*Table structure for table `tbltimesheet` */

DROP TABLE IF EXISTS `tbltimesheet`;

CREATE TABLE `tbltimesheet` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `temp` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `idacct` int(11) DEFAULT NULL,
  `day` varchar(15) COLLATE utf8_unicode_ci DEFAULT NULL,
  `date` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `idshift` int(11) DEFAULT NULL,
  `shiftin` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `shiftout` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `date_in` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `timein` varchar(15) COLLATE utf8_unicode_ci DEFAULT NULL,
  `date_out` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `timeout` varchar(15) COLLATE utf8_unicode_ci DEFAULT NULL,
  `late` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `ut` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `absent` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `reghrs` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `acthrs` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `excess` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `ot` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `idleavesheet` int(11) DEFAULT NULL,
  `idotsheet` int(11) DEFAULT NULL,
  `idadjsheet` int(11) DEFAULT NULL,
  `id_payperiod` int(11) DEFAULT NULL,
  `np` varchar(11) COLLATE utf8_unicode_ci DEFAULT NULL,
  `np_rate` varchar(10) COLLATE utf8_unicode_ci DEFAULT '1.000',
  PRIMARY KEY (`id`),
  KEY `sheetKey1` (`idleavesheet`),
  KEY `sheetKey2` (`idotsheet`),
  KEY `sheetKey3` (`idadjsheet`),
  KEY `sheetKey4` (`idacct`),
  KEY `sheetKey5` (`idshift`),
  KEY `sheetKey6` (`date`),
  KEY `sheetKey7` (`id_payperiod`)
) ENGINE=MyISAM AUTO_INCREMENT=1011 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

