CREATE TABLE `tbltimeshift` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `docnumber` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `creator` int(11) DEFAULT NULL,
  `idacct` int(11) DEFAULT NULL,
  `oldshift` int(11) DEFAULT NULL,
  `idshift` int(11) DEFAULT NULL,
  `date` date DEFAULT NULL,
  `remarks` text COLLATE utf8_unicode_ci DEFAULT NULL,
  `file` varchar(25) COLLATE utf8_unicode_ci DEFAULT NULL,
  `stat` int(1) NOT NULL DEFAULT 3,
  `cancelby` int(11) DEFAULT NULL,
  `cancel_date` date DEFAULT NULL,
  `cancel_time` time DEFAULT NULL,
  `approver1` int(11) DEFAULT NULL,
  `approver1_date` date DEFAULT NULL,
  `approver1_time` time DEFAULT NULL,
  `approver1_reason` text COLLATE utf8_unicode_ci DEFAULT NULL,
  `approver1_stat` int(11) DEFAULT NULL,
  `id_payperiod` int(11) NOT NULL,
  `date_create` date NOT NULL,
  PRIMARY KEY (`id`),
  KEY `shiftKeyCS1` (`idshift`),
  KEY `shiftKeyCS2` (`idacct`),
  KEY `shiftKeyCS3` (`oldshift`),
  KEY `shiftKeyCS4` (`date`)
