DELIMITER $$

/*!50106 CREATE DEFINER=`root`@`localhost` EVENT `insert_event` ON SCHEDULE EVERY 1 MINUTE STARTS '2020-12-03 11:05:21' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
	    CALL psp_insertlogs();
	END */$$
