/* Procedure structure for procedure `psp_insertlogs` */

/*!50003 DROP PROCEDURE IF EXISTS  `psp_insertlogs` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `psp_insertlogs`()
BEGIN
DECLARE acctid VARCHAR(10);
DECLARE workdate VARCHAR(20);
DECLARE worktime VARCHAR(10);
DECLARE timetype VARCHAR(4);
DECLARE emp_temp VARCHAR(10);
DECLARE done INT DEFAULT FALSE;
DECLARE cursor_select CURSOR FOR SELECT acct_id,work_date, work_time, time_type, temp FROM  faceid_logs WHERE DATE_ADD(CURRENT_TIMESTAMP(),INTERVAL -1 HOUR) < concat(work_date,' ',work_time);
DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
OPEN cursor_select;
read_loop: LOOP
FETCH cursor_select INTO acctid, workdate, worktime,timetype,emp_temp;
	IF done THEN
	LEAVE read_loop;
	END IF;	
	IF NOT EXISTS(SELECT * FROM tbltimelogs WHERE acct_id = acctid AND  work_date=workdate AND work_time = worktime) then	
		
		INSERT INTO tbltimelogs (acct_id,work_date,work_time,time_type,temp) VALUES(acctid, workdate, worktime,timetype,emp_temp);
		
		CALL psp_updatetimelogs('FACE');
		CALL psp_logspairing(acctid,workdate,concat('F',DATE_FORMAT(workdate, '%Y%m%d')));
	END IF;	
	
END LOOP;
#CALL `2hrisdbic`.`psp_updatetimelogs`('FACE');
CLOSE cursor_select; 
    END */$$
DELIMITER ;

