IF timetype =type_in THEN
INSERT INTO tbltimelogpair(batchid,machid,work_date,idshift,idacct,idunit,date_in1,time_in1,sdate,fdate,create_stamp,temp) VALUES (batch_id,new_alias,workdate,id_shift,id_acct,id_unit,workdate,worktime,p_start, p_end, CURRENT_TIMESTAMP(),emp_temp);
ELSEIF timetype =type_out THEN
INSERT INTO tbltimelogpair(batchid,machid,work_date,idshift,idacct,idunit,date_out1,time_out1,sdate,fdate,create_stamp,temp) VALUES (batch_id,new_alias,workdate,id_shift,id_acct,id_unit,workdate,worktime,p_start, p_end, CURRENT_TIMESTAMP(),emp_temp);
END IF;
END IF;
ELSEIF link_time_in IS NOT NULL AND link_time_out IS NOT NULL THEN
IF (link_time_in2 IS NULL AND link_time_out2 IS NULL) OR link_time_out2 IS NOT NULL THEN
IF timetype =type_in THEN
INSERT INTO tbltimelogpair(batchid,machid,work_date,idshift,idacct,idunit,date_in1,time_in1,sdate,fdate,create_stamp,temp) VALUES (batch_id,new_alias,workdate,id_shift,id_acct,id_unit,workdate,worktime,p_start, p_end, CURRENT_TIMESTAMP(),emp_temp);
ELSEIF timetype =type_out THEN
INSERT INTO tbltimelogpair(batchid,machid,work_date,idshift,idacct,idunit,date_out1,time_out1,sdate,fdate,create_stamp,temp) VALUES (batch_id,new_alias,workdate,id_shift,id_acct,id_unit,workdate,worktime,p_start, p_end, CURRENT_TIMESTAMP(),emp_temp);
END IF;
ELSEIF link_time_in2 IS NOT NULL AND link_time_out2 IS NULL THEN
IF link_date_in2 = workdate THEN
UPDATE tbltimelogpair SET date_in1 = link_date_in2, time_in1 = link_time_in2, date_out1= workdate, time_out1 = worktime, date_in2=NULL,time_in2=NULL, date_out2=NULL, time_out2=NULL WHERE id = link_id;
ELSE
UPDATE tbltimelogpair SET date_out2 = workdate, time_out2 = worktime WHERE id = link_id;
END IF;
END IF;
ELSEIF link_time_in IS NOT NULL AND link_time_out IS NOT NULL THEN
IF link_time_in2 IS NULL AND link_time_out2 IS NULL THEN
IF IFNULL((TIMESTAMPDIFF(SECOND,CONCAT(link_date_in,' ',link_time_in),CONCAT(workdate,' ',worktime)))/60/60,0) < 24 THEN
SELECT '01';
#UPDATE tbltimelogpair SET date_out1 = workdate, time_out = worktime WHERE id = link_id;
ELSEIF IFNULL((TIMESTAMPDIFF(SECOND,CONCAT(link_date_in,' ',link_time_in),CONCAT(workdate,' ',worktime)))/60/60,0) > 1 THEN
#INSERT INTO tbltimelogpair(machid,work_date,idshift,idacct,idunit,date_out1,time_out1) VALUES (new_alias,workdate,id_shift,id_acct,id_unit,workdate,worktime);
SELECT '02';
END IF;
ELSEIF link_time_in2 IS NOT NULL AND link_time_out2 IS NULL THEN
IF IFNULL((TIMESTAMPDIFF(SECOND,CONCAT(link_date_in2,' ',link_time_in2),CONCAT(workdate,' ',worktime)))/60/60,0) > 0 THEN
UPDATE tbltimelogpair SET date_out2 = workdate, time_out2 = worktime WHERE id = link_id;
END IF;
END IF;
END IF;
END IF;
END IF;
CALL psp_timesheetprocessing(id_shift, workdate, id_acct, emp_temp,id_payperiod);
END LOOP;
CLOSE cursor_select;
END */$$
DELIMITER ;

/* Procedure structure for procedure `psp_timesheetprocessing` */

/*!50003 DROP PROCEDURE IF EXISTS  `psp_timesheetprocessing` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `psp_timesheetprocessing`(IN shift_id INT, IN workdate VARCHAR(20), IN id_acct INT, IN emp_temp VARCHAR(10),IN idpayperiod INT)
BEGIN
DECLARE sched_in VARCHAR(20);
DECLARE sched_out VARCHAR(20);
DECLARE shift_in VARCHAR(20);
DECLARE shift_out VARCHAR(20);
DECLARE noon_in VARCHAR(20);
DECLARE noon_out VARCHAR(20);
DECLARE timesheet_id INT;
DECLARE datein VARCHAR(20);
DECLARE timein VARCHAR(10);
DECLARE dateout VARCHAR(20);
DECLARE timeout VARCHAR(10);
DECLARE link_time_in VARCHAR(20);
DECLARE link_time_out VARCHAR(20);
DECLARE late DECIMAL(6,2);
DECLARE undertime DECIMAL(6,2);
DECLARE absent DECIMAL(6,2);
DECLARE reghrs DECIMAL(6,2);
DECLARE acthrs DECIMAL(6,2);
DECLARE excess DECIMAL(6,2);
DECLARE noonbreak DECIMAL(6,2);
SELECT stime,ftime, CONCAT(workdate,' ',stime),CASE WHEN stime >= '00:00:00' THEN CONCAT(workdate,' ',ftime) ELSE CONCAT(DATE_ADD(workdate,INTERVAL 1 DAY),' ',ftime)END,CASE WHEN stime >= '00:00:00' THEN CONCAT(workdate,' ',breakin) ELSE CONCAT(DATE_ADD(workdate,INTERVAL 1 DAY),' ',breakin)END,CASE WHEN stime >= '00:00:00' THEN CONCAT(workdate,' ',breakout) ELSE CONCAT(DATE_ADD(workdate,INTERVAL 1 DAY),' ',breakout)END INTO sched_in,sched_out,shift_in,shift_out,noon_in,noon_out FROM tblshift WHERE tblshift.id = shift_id;
SELECT date_in,time_in,date_out,time_out, CONCAT(date_in,' ',time_in), CONCAT(date_out,' ',time_out) INTO datein,timein,dateout,timeout,link_time_in,link_time_out FROM vw_dataloglink WHERE vw_dataloglink.idacct = id_acct AND vw_dataloglink.work_date = workdate;
SELECT id INTO timesheet_id FROM vw_data_timesheet WHERE vw_data_timesheet.empid=id_acct AND vw_data_timesheet.work_date=workdate;
IF timesheet_id IS NOT NULL THEN
IF link_time_in IS NOT NULL OR link_time_out IS NOT NULL THEN
#late
IF shift_in < link_time_in THEN
SET late = TIMESTAMPDIFF(SECOND,shift_in,link_time_in)/60/60;
ELSE
SET late = 0;
END IF;
#undertime
IF link_time_out < shift_out THEN
SET undertime = TIMESTAMPDIFF(SECOND,link_time_out,shift_out)/60/60;
IF link_time_out < noon_in THEN
SET undertime = undertime - IFNULL(TIMESTAMPDIFF(SECOND,noon_in,noon_out)/60/60,0);
END IF;
ELSE
SET undertime = 0;
END IF;
#absent
IF link_time_in IS NULL AND link_time_out IS NULL THEN
SET absent = TIMESTAMPDIFF(SECOND,shift_in,shift_out)/60/60;
ELSE
SET absent = 0;
END IF;
#excess
IF shift_out > link_time_out THEN
SET excess = TIMESTAMPDIFF(SECOND,shift_out,link_time_out)/60/60;
IF excess < 0 THEN
SET excess=0;
END IF;
ELSE
SET excess = 0;
END IF;
#reghrs
SET noonbreak = IFNULL(TIMESTAMPDIFF(SECOND,noon_in,noon_out)/60/60,0);
SET reghrs = (TIMESTAMPDIFF(SECOND,shift_in,shift_out)/60/60-(noonbreak+late+undertime));
#acthrs
SET acthrs = TIMESTAMPDIFF(SECOND,link_time_in,link_time_out)/60/60;
ELSE
SET absent = ((TIMESTAMPDIFF(SECOND,shift_in,shift_out)/60/60)-noonbreak);
SET late = 0;
SET undertime = 0;
SET acthrs = 0;
SET excess = 0;
SET reghrs = 0;
END IF;
UPDATE tbltimesheet SET date_in = datein,timein = timein ,date_out = dateout,timeout = timeout,late = late,ut = undertime,absent = absent,reghrs = reghrs,acthrs = acthrs,excess = excess WHERE tbltimesheet.id = timesheet_id;
ELSE
IF link_time_in IS NOT NULL OR link_time_out IS NOT NULL THEN
#late
IF shift_in < link_time_in THEN
SET late = TIMESTAMPDIFF(SECOND,shift_in,link_time_in)/60/60;
ELSE
SET late = 0;
END IF;
#undertime
IF link_time_out < shift_out THEN
SET undertime = TIMESTAMPDIFF(SECOND,link_time_out,shift_out)/60/60;
IF link_time_out < noon_in THEN
SET undertime = undertime - IFNULL(TIMESTAMPDIFF(SECOND,noon_in,noon_out)/60/60,0);
END IF;
ELSE
SET undertime = 0;
END IF;
#absent
IF link_time_in IS NULL AND link_time_out IS NULL THEN
SET absent = TIMESTAMPDIFF(SECOND,shift_in,shift_out)/60/60;
ELSE
SET absent = 0;
END IF;
#excess
IF shift_out > link_time_out THEN
SET excess = TIMESTAMPDIFF(SECOND,shift_out,link_time_out)/60/60;
IF excess < 0 THEN
SET excess=0;
END IF;
ELSE
SET excess = 0;
END IF;
#reghrs
SET noonbreak = IFNULL(TIMESTAMPDIFF(SECOND,noon_in,noon_out)/60/60,0);
SET reghrs = (TIMESTAMPDIFF(SECOND,shift_in,shift_out)/60/60-(noonbreak+late+undertime));
#acthrs
SET acthrs = TIMESTAMPDIFF(SECOND,link_time_in,link_time_out)/60/60;
ELSE
SET absent = ((TIMESTAMPDIFF(SECOND,shift_in,shift_out)/60/60)-noonbreak);
SET late = 0;
SET undertime = 0;
SET acthrs = 0;
SET excess = 0;
SET reghrs = 0;
END IF;
INSERT INTO tbltimesheet(idacct,DAY,DATE,idshift,shiftin,shiftout,date_in,timein,date_out,timeout,late,ut,absent,reghrs,acthrs,excess,temp,id_payperiod)VALUES(id_acct,DAYNAME(workdate),workdate,shift_id,sched_in,sched_out,datein,timein,dateout,timeout,late,undertime,absent,reghrs,acthrs,excess,emp_temp,idpayperiod);
END IF;
END */$$
DELIMITER ;

/* Procedure structure for procedure `psp_updatetimelogs` */

/*!50003 DROP PROCEDURE IF EXISTS  `psp_updatetimelogs` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `psp_updatetimelogs`(in alias varchar(10))
BEGIN
	DECLARE id_conf VARCHAR(10);
	DECLARE id_unit INT;
	DECLARE row_id INT;
	DECLARE acctid VARCHAR(10);
	DECLARE workdate NVARCHAR(20);	
	DECLARE done INT DEFAULT FALSE;
	DECLARE cursor_select CURSOR FOR SELECT id,acct_id,work_date FROM tbltimelogs WHERE idconf IS NULL; # and date_add(CURRENT_TIMESTAMP(),interval -30 minute) < CAST(CONCAT(work_date,' ',work_time)AS DATETIME);
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
		
	OPEN cursor_select;
	read_loop: LOOP
	FETCH cursor_select INTO row_id, acctid, workdate;
		IF done THEN
		LEAVE read_loop;
		END IF;		
		
		SELECT id INTO id_conf FROM tbltimelogsconf WHERE tbltimelogsconf.alias = alias;
		SELECT idunit INTO id_unit FROM vw_dataemployees WHERE vw_dataemployees.empid=acctid;
		
		
		UPDATE tbltimelogs SET idconf = id_conf, idunit = id_unit WHERE tbltimelogs.id = row_id;
		SELECT 	acctid,workdate;
		#call psp_pairing(acctid,workdate);
		
	END LOOP;
	CLOSE cursor_select;
    END */$$
DELIMITER ;

